03c- read.csv(\u0022../input/train.csv\u0022)\ntemptest  \u003c- read.csv(\u0022../input/test.csv\u0022)\n\ntrain\u003c-temptrain[,c(\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Sex\u0022,\u0022Pclass\u0022, \u0022Fare\u0022,\u0022Survived\u0022)]\ntest\u003c-temptest[,c(\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Sex\u0022, \u0022Pclass\u0022, \u0022Fare\u0022,\u0022PassengerId\u0022)]\n\ntrain[,\u0022Sex\u0022]\u003c-as.numeric(train[,\u0022Sex\u0022])\ntest[,\u0022Sex\u0022]\u003c-as.numeric(test[,\u0022Sex\u0022])\ntrain[,\u0022Pclass\u0022]\u003c-as.numeric(train[,\u0022Pclass\u0022])\ntest[,\u0022Pclass\u0022]\u003c-as.numeric(test[,\u0022Pclass\u0022])\n\ntrain[is.na(train)]\u003c-0\ntest[is.na(test)]\u003c-0\n\n#Silly way to force the dataframe into numeric. I spent so long frustrated with this!\ntrain[[1,\u0022SibSp\u0022]]\u003c-1.00\ntrain[[1,\u0022Parch\u0022]]\u003c-0.00\n\ntest[[1,\u0022SibSp\u0022]]\u003c-0.00\ntest[[1,\u0022Parch\u0022]]\u003c-0.00\n\nstr(train)\nstr(test)\nsummary(train)\nsummary(test)\n\n\nparam       = list(\u0022objective\u0022 = \u0022multi:softmax\u0022, # multi class classification\n\t      \u0022num_class\u0022= 2 ,  \t\t# Number of classes in the dependent variable.\n              \u0022eval_metric\u0022 = \u0022mlogloss\u0022,  \t # evaluation metric \n              \u0022nthread\u0022 = 8,   \t\t\t # number of threads to be used \n              \u0022max_depth\u0022 = 16,    \t\t # maximum depth of tree \n              \u0022eta\u0022 = 0.3,    \t\t\t # step size shrinkage \n              \u0022gamma\u0022 = 0,    \t\t\t # minimum loss reduction \n              \u0022subsample\u0022 = 0.7,    \t\t # part of data instances to grow tree \n              \u0022colsample_bytree\u0022 = 1, \t\t # subsample ratio of columns when constructing each tree \n              \u0022min_child_weight\u0022 = 12  \t\t # minimum sum of instance weight needed in a child \n              )\n\n#Identify the Predictors and the dependent variable, aka label.\npredictors = colnames(train[,-ncol(train)])\nstr(predictors)\n#xgboost works only if the labels are numeric. Hence, convert the labels (Species) to numeric.\nlabel = as.numeric(train[,\u0022Survived\u0022])\nprint(table (label))\n#Alas, xgboost works only if the numeric labels start from 0. Hence, subtract 1 from the label.\nprint(table (label))\n\nbst = xgboost(\n\t\tparam=param,\n\t\tdata =as.matrix(train[,predictors]),\n\t\tlabel = label,\n\t\tnrounds=1000)\n\n# Make prediction on the testing data.\n\ntrain.prediction = predict(bst, as.matrix(test))\n\noutput\u003c-data.frame(test$PassengerId,train.prediction)\n\ncolnames(output)\u003c-cbind(\u0022PassengerId\u0022,\u0022Survived\u0022)\n\nwrite.csv(output, file = \u0027Rushton_Solution.csv\u0027, row.names = F)\n\n\n\n","dateCreated":"2017-02-06T05:30:56.697Z"},"kernelRun":{"id":818089,"kernelId":176316,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"XGBoost for Titanic ","dateCreated":"2017-02-06T05:30:56.697Z","dateEvaluated":"2017-02-06T05:30:56.52Z","workerContainerPort":null,"workerUptimeSeconds":1128314,"workerIPAddress":"10.3.0.8       ","scriptLanguageId":1,"scriptLanguageName":"R","renderedOutputUrl":null,"commit":{"id":7227423,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n# This R script will run on our backend. You can write arbitrary code here!\n\n# Many standard libraries are already installed, such as randomForest\nlibrary(randomForest)\nlibrary(Matrix)\nlibrary(xgboost)\n\n# The train and test data is stored in the ../input directory\ntemptrain \u003c- read.csv(\u0022../input/train.csv\u0022)\ntemptest  \u003c- read.csv(\u0022../input/test.csv\u0022)\n\ntrain\u003c-temptrain[,c(\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Sex\u0022,\u0022Pclass\u0022, \u0022Fare\u0022,\u0022Survived\u0 eSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the ground truth) for each passenger. Your model will be based on features like passengers gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancs were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":818089,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-02-06T05:30:56.697Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":0,"linesInsertedFromPrevious":0,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:099e2c708d3a30f804e8c9e344806f3d4885924a5fbf76863672dc6e9b7cab3a","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":10.0674490940291,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"XGBoost for Titanic ","url":"/brirush/xgboost-for-titanic?scriptVersionId=818089","versionNumber":92,"hasVersionNumber":true,"isRedacted":false,"versionAuthor":null},{"id":817948,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-02-06T04:41:30.083Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":3,"linesInsertedFromPrevious":3,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:099e2c708d3a30f804e8c9e344806f3d4885924a5fbf76863672dc6e9b7cab3a","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValid
